#include <iostream>

using namespace std;

template <typename T>
class Vector {

public:
    Vector() : size_(0), capacity_(4), arr_(new T[4]) {}

    explicit Vector(const int vector_capacity) : size_(0), capacity_(vector_capacity), arr_(new T[vector_capacity]) {}

    Vector(const Vector& other) : size_(other.size_), capacity_(other.capacity_), arr_(new T[capacity_]) {
        for (int i = 0; i < size_; i++) {
            arr_[i] = other.arr_[i];
        }
        total_number_elements_ += size_;
    } // –∫–æ–Ω—Å—Ç—Ä—É–∫—Ç–æ—Ä –∫–æ–ø–∏—Ä–æ–≤–∞–Ω–∏—è

    Vector(const initializer_list<T>& list) : size_(list.size()), capacity_(list.size()), arr_(new T[list.size()]) {
        int i = 0;
        for (const T& element : list) {
            arr_[i] = element;
            i++;
        }
    }

    Vector& operator=(const Vector& other) {
        if (&other != this) { // –ø—Ä–æ–≤–µ—Ä–∫–∞ –Ω–∞ —Å–∞–º–æ–ø—Ä–∏—Å–≤–∞–∏–≤–∞–Ω–∏–µ
            total_number_elements_ += other.size_ - size_; // –æ–±—â–µ–µ –∫–æ–ª–∏—á–µ—Å—Ç–≤–æ —É–≤–µ–ª–∏—á–∏–≤–∞–µ—Ç—Å—è (—É–º–µ–Ω—å—à–∞–µ—Ç—Å—è) –Ω–∞ —Ä–∞–∑–Ω–æ—Å—Ç—å —ç–ª–µ–º–µ–Ω—Ç–æ–≤
            size_ = other.size_;
            capacity_ = other.capacity_;
            delete[] arr_;
            arr_ = new T[capacity_];
            for (int i = 0; i < size_; i++) {
                arr_[i] = other.arr_[i];
            }
        }
        return *this;
    } // –∫–æ–ø–∏—Ä—É—é—â–∏–π –æ–ø–µ—Ä–∞—Ç–æ—Ä –ø—Ä–∏—Å–≤–∞–∏–≤–∞–Ω–∏—è =

    Vector(Vector&& other) : size_(other.size_), capacity_(other.capacity_), arr_(other.arr_) {
        other.arr_ = nullptr;
        other.size_ = 0;
        other.capacity_ = 0;
    } // –∫–æ–Ω—Å—Ç—Ä—É–∫—Ç–æ—Ä –ø–µ—Ä–µ–º–µ—â–µ–Ω–∏—è

    Vector& operator=(Vector&& other) {
        if (&other != this) {
            total_number_elements_ += other.size_ - size_; // –æ–±—â–µ–µ –∫–æ–ª–∏—á–µ—Å—Ç–≤–æ —É–≤–µ–ª–∏—á–∏–≤–∞–µ—Ç—Å—è (—É–º–µ–Ω—å—à–∞–µ—Ç—Å—è) –Ω–∞ —Ä–∞–∑–Ω–æ—Å—Ç—å —ç–ª–µ–º–µ–Ω—Ç–æ–≤
            size_ = other.size_;
            capacity_ = other.capacity_;
            delete[] arr_;
            arr_ = other.arr_;
            other.arr_ = nullptr;
            other.size_ = 0;
            other.capacity_ = 0;
        }
        return *this;
    } // –ø–µ—Ä–µ–º–µ—â–∞—é—â–∏–π –æ–ø–µ—Ä–∞—Ç–æ—Ä –ø—Ä–∏—Å–≤–∞–∏–≤–∞–Ω–∏—è =

    void push_back(const T& value) {
        check_capacity();
        arr_[size_] = value;
        size_++;
        total_number_elements_++;
    }

    void pop_back() {
        if (size_ == 0) {
            throw runtime_error("–ü–æ–ø—ã—Ç–∫–∞ —É–¥–∞–ª–µ–Ω–∏—è –≤ –ø—É—Å—Ç–æ–º –∫–æ–Ω—Ç–µ–π–Ω–µ—Ä–µ");
        }
        size_--;
        total_number_elements_--;
    }

    void insert(const int index, const T& value) { // —Ç–∏–ø—ã –æ—à–∏–±–æ–∫ –º–æ–∂–Ω–æ —Ä–∞–∑–¥–µ–ª–∏—Ç—å
        if (index < 0 || index >= size_) {
            throw logic_error("–ù–µ–∫–æ—Ä—Ä–µ–∫—Ç–Ω—ã–π –∏–Ω–¥–µ–∫—Å");
        }
        check_capacity();
        for (int i = size_; i > index; i--) {
            arr_[i] = arr_[i - 1];
        }
        arr_[index] = value;
        size_++;
        total_number_elements_++;
    }

    void erase(const int index) {
        if (index < 0 || index >= size_) {
            throw logic_error("–ù–µ–∫–æ—Ä—Ä–µ–∫—Ç–Ω—ã–π –∏–Ω–¥–µ–∫—Å");
        }
        for (int i = index; i < size_ - 1; i++) {
            arr_[i] = arr_[i + 1];
        }
        size_--;
        total_number_elements_--;
    }

    T& operator[](const int index) {
        if (index < 0 || index >= size_) {
            throw logic_error("–ù–µ–∫–æ—Ä—Ä–µ–∫—Ç–Ω—ã–π –∏–Ω–¥–µ–∫—Å");
        }
        return arr_[index];
    }

