    //vec.insert(9, 12); // –≤ –±–ª–æ–∫ try –æ–±–æ—Ä–∞—á–∏–≤–∞–µ–º —Ñ—É–Ω–∫—Ü–∏—é (–±–ª–æ–∫ –∫–æ–¥–∞) –≥–¥–µ –º–æ–∂–µ—Ç –±—ã—Ç—å –≤—ã–±—Ä–æ—à–µ–Ω–æ –∏—Å–∫–ª—é—á–µ–Ω–∏–µ

