    catch (const out_of_range& ex) { // –ª–æ–≤–∏–º –≤ –æ–¥–Ω–æ–º –±–ª–æ–∫–µ catch –∫–æ–Ω–∫—Ä–µ—Ç–Ω—ã–π —Ç–∏–ø –æ—à–∏–±–∫–∏
