    catch(const logic_error& ex) { // –ª–æ–≤–∏–º –≤ –æ–¥–Ω–æ–º –±–ª–æ–∫–µ catch –ª—é–±—ã–µ –æ—à–∏–±–∫–∏ —Ä–∞–∑–Ω–æ–≤–∏–¥–Ω–æ—Å—Ç–∏ logic_error
