    } else if (ingredient1 === "oil" || ingredient2 === "oil") {
      return "Stealth potion";
    } else {
      return "Minor stamina potion";
    }
  } else if (ingredient1 === "berries" || ingredient2 === "berries") {
    if (ingredient1 === "sugar" || ingredient2 === "sugar") {
      return "Speed potion";
    } else {
      return "Minor energy potion";
    }
  } else {
    return "No potion";
  }
}

